<!-- This is a SVG map with hover and click actions that display data pulled from a MySQL database -->
<script>
<?php

$arrCnt = 0;
$total = 0;
$terms = get_terms( array(
    'taxonomy' => 'activity', // Territories taxonomy
    'hide_empty' => false,
));

// Get the count for the territories array.
foreach( $terms as $term ) 
{
	if ($term->parent != 0)
	{
		if($term->slug == 'britain' || $term->slug == 'northern-ireland' || $term->slug == 'southern-ireland')
		{
		}
		else
		{
			$total += 1;
		}
	}
}

// Create the JavaScript array containers
echo 'var territories = [' . $total . '];' . PHP_EOL;
echo 'var statenames = [' . $total . '];' . PHP_EOL;

// Populate the JavaScript array containers
foreach( $terms as $term ) 
{
	if ($term->parent != 0)
	{
		if($term->slug == 'britain' || $term->slug == 'northern-ireland' || $term->slug == 'southern-ireland')
		{
		}
		else
		{
			$term_slug = $term->slug;
			echo 'territories[' . $arrCnt . '] = "' . $term_slug  . '";' . PHP_EOL;
			echo 'statenames[' . $arrCnt . '] = "' . $term->name  . '";' . PHP_EOL;
			$arrCnt += 1;
		}
	}
}
?>

function showMapInfo(which)
{
	showDefault = true;
	for(xyz=0;xyz<10;xyz++)
	{
		anElement = document.getElementsByName("info_" + which)[xyz];
	
		if(typeof anElement != 'undefined' && anElement)
		{
			//alert('1');	
		}
		else
		{
			//alert('2');	
		}
	}
	
	document.getElementById("rep-info-copy").innerHTML = statenames[territories.indexOf(which)];
	document.getElementById("info_default").style.display = "none";	
	for(x=0;x<<?php echo $total; ?>;x++)
	{
		for(xyz=0;xyz<10;xyz++)
		{
			curElement = document.getElementsByName("info_" + territories[x])[xyz];
			if(typeof curElement != 'undefined' && curElement)
			{
				document.getElementsByName("info_" + territories[x])[xyz].style.display = "none";
			}
		}
	}
	
	for(xyz=0;xyz<10;xyz++)
		{
		curElement = document.getElementsByName("info_" + which)[xyz];
	
		if(typeof curElement != 'undefined' && curElement)
		{
			showDefault = false;
			document.getElementsByName("info_" + which)[xyz].style.display = "block";	
		}
	}
	
	if(showDefault)
	{
		document.getElementById("info_default").style.display = "block";	
	}
}
</script>
